import styled from "styled-components";

type ContainerPropsType = {
    margin?: string
}

export const Container = styled.div<ContainerPropsType>`
    max-width: 1200px;
    width: 100%;
    min-height: 100%;
    padding: 0 15px;
    margin: 0 auto;
    border: 1px solid red;
   margin: ${props => props.margin};
`
